function processResults(t){$("#betSearchResults > tbody").empty();for(var e=t.length-1;e>=0;e--)$("#betSearchResults > tbody").prepend("<tr><td>"+t[e].bet_id+"</td><td>"+t[e].username+"</td><td>"+t[e].bet_time+"</td><td>"+t[e].bet_amount.toFixed(8)+"</td><td>"+t[e].payout.toFixed(4)+"</td><td>"+t[e].game+"</td><td>"+t[e].roll+"</td><td>"+t[e].profit.toFixed(8)+"</td><td>"+t[e].result+"</td><td>"+t[e].server_seed+"</td><td>"+t[e].client_seed+"</td></tr>");$("#betSearchResults").dataTable({aaSorting:[[0,"desc"]],bDestroy:!0})}$(document).ready(function(){$("#betSearchForm").submit(function(t){args={q:$("#q").val(),output:"json"},$.ajax({url:"/bets",type:"get",data:args,success:function(t){results=$.parseJSON(t).searchResults,$("#betSearchResults").fadeOut(400,function(){processResults(results),$(this).fadeIn(400)})},error:function(t){alert(t)}}),t.preventDefault()})});